import React, { useState } from 'react';

//ui packages
import { Container, Avatar, Paper, Grid, Typography, Button } from '@material-ui/core';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';

// pakages
import { ToastContainer, toast, cssTransition } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import GoogleLogin from 'react-google-login';

//style
import useStyles from './Styles';

// components
import InputField from './InputField';
import Icon from './icon';

const bounce = cssTransition({
    enter: "animate__animated animate__bounceIn",
    exit: "animate__animated animate__bounceOut"
});

const Auth = () => {
    const [showPassword, setShowPassword] = useState(false);
    const [isSignUp, setIsSignUp] = useState(false);
    const classes = useStyles();

    const handlePasswordShow = () => setShowPassword((prvShowPassword) => !prvShowPassword);

    const handleSubmit = () => {
        toast.error('Sign In', {
            position: "bottom-right",
            transition: bounce
        });
    };

    const handleOnChange = () => {

    };

    const switchMode = () => {
        setIsSignUp((prvIssignUp) => !prvIssignUp);
        setShowPassword(false);
    };

    const googleSuccess = async (res) => {
        console.log(res);
        toast.success(res, {
            position: "bottom-right",
            transition: bounce
        });
    };

    const googleFaliure = (error) => {
        console.log(error);
        toast.error(error, {
            position: "bottom-right",
            transition: bounce
        });
    };

    return (
        <>
            <Container component="main" maxWidth="xs">
                <Paper className={classes.paper} elevation={3}>
                    <Avatar className={classes.avatar}>
                        <LockOutlinedIcon />
                    </Avatar>
                    <Typography variant='h5'>{isSignUp ? "Sign Up" : "Sign In"}</Typography>
                    <form className={classes.form} onSubmit={handleSubmit}>
                        <Grid container spacing={2}>
                            {
                                isSignUp && (
                                    <>
                                        <InputField
                                            name="firstName"
                                            label='firstName'
                                            handleOnChange={handleOnChange}
                                            autoFocus
                                            half
                                        />
                                        <InputField
                                            name="firstName"
                                            label='firstName'
                                            handleOnChange={handleOnChange}
                                            autoFocus
                                            half
                                        />
                                    </>
                                )}
                            <InputField
                                name='email'
                                label='Email Address'
                                handleOnChange={handleOnChange}
                                type="email"
                            />
                            <InputField
                                name='password'
                                label='Password'
                                handleOnChange={handleOnChange}
                                type={showPassword ? 'text' : 'password'}
                                handlePasswordShow={handlePasswordShow}
                            />
                            {
                                isSignUp && <InputField name='confirmPassword' label="Repeat Password" handleOnChange={handleOnChange} type='password' />
                            }
                        </Grid>
                        <Button fullWidth type='submit' variant='contained' color='primary' className={classes.submit}>{isSignUp ? 'Sign Up' : 'sign In'}</Button>
                        <GoogleLogin
                            clientId="968502154569-8s1u0kkg5064onsq180f5s5bqln3htsp.apps.googleusercontent.com"
                            render={(renderPrpos) => (
                                <Button
                                    className={classes.googleButton}
                                    color='primary'
                                    fullWidth
                                    onClick={renderPrpos.onClick}
                                    disabled={renderPrpos.disabled}
                                    startIcon={<Icon />}
                                    variant='contained'
                                >
                                    Google Sign In
                                </Button>
                            )}
                            onSuccess={googleSuccess}
                            onFailure={googleFaliure}
                            cookiePolicy={'single_host_origin'}
                        />

                        <Grid container justify='flex-end'>
                            <Grid item>
                                <Button onClick={switchMode}>
                                    {isSignUp ? "Already have an account? Sign In" : "Don't have account? Sign Up"}
                                </Button>
                            </Grid>

                        </Grid>
                    </form>
                </Paper>
            </Container>
            <ToastContainer
                position="bottom-right"
                autoClose={3000}
                hideProgressBar={false}
                newestOnTop={false}
                closeOnClick
                rtl={false}
                pauseOnFocusLoss
                draggable
                pauseOnHover
                theme="colored"
                transition={bounce}
            />
        </>
    );
}

export default Auth;
